import { Row, Container } from 'react-bootstrap'
import { Col } from 'react-bootstrap'

class GCOutput extends React.Component {
    state = {
        sequences: []
    };

    componentDidMount() {
        this.resetState();
      }

    getSequences = () => {
        axios.get(API_URL)
            .then(res => this.setState({ sequences: res.data[res.length-1]}))
            .catch(console.log)
    }

    resetState = () => {
        this.getSequences();
    }
    render() {
        return (
            <Container>
                <Row>
                    <Col>
                        A:
                        <textarea
                            id="Sequence"
                            label="Seq"
                            value={this.resetState}
                        /> 
                    </Col>
                </Row>
            </Container>
        )

    }
}



export default GCOutput;
